INSERT INTO `lang_definitions` VALUES (19275, 669, 15, 'Πατήστε \"εξαγωγή\" για να εξάγετε την Κατηγορία, Υποκατηγορία, Αντικείμενο, τα περιεχόμενα Δεδομένα σε ένα αρχείο. Οποιαδήποτε ομοιότητα αυτού του αρχείου με ένα αρχείο XML είναι καθαρά τυχαία. Το άνοιγμα και το κλείσιμο ετικετών πρέπει να είναι στην ίδια γραμμή, θα πρέπει να είναι με πεζά γράμματα χωρίς κενά. Για την εισαγωγή, αναζητήστε ένα αρχείο και κάντε κλικ στο κουμπί «εισαγωγή». Εάν τα δεδομένα είναι εντελώς διαφορετικά, θα συγχωνευτούν με τα υπάρχοντα δεδομένα σας. Αν υπάρχουν ίδια ονόματα αντικειμένων, το παλιό θα κρατηθεί και το νέο θα αποθηκευθεί με έναν αριθμό που θα προστεθεί στο τέλος.');
